import React from "react";

const Main = () => {
  return (
    <>
      <h1>Book a Table</h1>
      <form>
        <div>
          <input type="radio" name="table-size" value="2" /> 2-person table
          <input type="radio" name="table-size" value="4"  /> 4-person table
          <input type="radio" name="table-size" value="6" /> 6-person table
        </div>
        <div>
          <input type="radio" value="indoors" name="location"/>
             
        </div>
      </form>
    </>
  );
};

export default Main;
